import Head from "next/head";
import React from "react";
import AppLayout from "../compoments/AppLayout";

const Signup = () => {
    return (
        <>
            <Head>
                <title>내 프로필 | NodeBird</title>
            </Head>
            <AppLayout>회원 가입</AppLayout>
        </>
    );
};

export default Signup;
